var postModule=angular.module("post",["app.config"]);postModule.factory("PostService",function(n,t){function r(n){return i.post(n)}function u(){var i=t.one(n.posts);return i.get()}function f(i){var r=t.one(n.postsById+"(PostId="+i+")");return r.get()}function e(i){var r=t.one(n.postsByUserId+"(UserId="+i+")");return r.get()}var i=t.all(n.addPost);return{addPost:r,getPostById:f,getPosts:u,getPostsByUserId:e}});postModule.factory("PostObjectComposer",function(){function n(n){return{Request:{PostId:n.UserId,Content:n.Content}}}return{generatePostObject:n}});postModule.controller("PostController",function(n,t,i){n.posts=t.getPosts();n.getPostById=function(n){return t.getPostById(n)};n.addPost=function(n){var r={PostId:0,Content:n};return t.addPost(i.generatePostObject(r))}});